import React from 'react';

import './App.css';
import {Botton,Form , FormGroup,Input,Label, Button} from 'reactstrap';
import {FacebookLoginButton} from 'react-social-login-buttons';

function App() {
  return (
    <Form className="App">
      <h1>
         <span className="font-weight-bold">myForm</span>
      </h1>
      <h2 className="text-center">Welcome</h2>
      <FormGroup>
       <Label>Name</Label>
       <Input type="text" placeholder="Name"></Input>
      </FormGroup>
      <FormGroup>
       <Label>Name</Label>
       <Input type="text" placeholder="Name"></Input>
      </FormGroup>
      <FormGroup>
       <Label>Email</Label>
       <Input type="email" placeholder="Email"></Input>
      </FormGroup>

      <Button className="btn-lg btn-dark btn-block">LogIn</Button>
      <div className="text-center pt-3"> or login with social account</div>
      <FacebookLoginButton className="mt-3 mb-3"></FacebookLoginButton>
    </Form>
  );
}

export default App;
